public boolean equals(final Object o) {
  if (this == o) { return true; }
  if (o == null || getClass() != o.getClass()) { return false; }
  final TtlTimeProvider that = (TtlTimeProvider) o;
  return authoritativeDirTtl == that.authoritativeDirTtl;
}
